import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import palette from "../../lib/styles/palette";
import Button from "../common/Button";
import Selector from "react-select";

/**
 * 회원가입 또는 로그인 폼을 보여줍니다.
 */

const AuthFormBlock = styled.div`
  h3 {
    vertical-align: top;
    margin: 0;
    color: ${palette.gray[8]};
    margin-bottom: 1rem;
  }
`;

/**
 * 스타일링된 input
 */
const StyledInput = styled.input`
  font-size: 1rem;
  display: table-cell;
  border: none;
  color: black;
  width: 360px;
  border-bottom: 1px solid ${palette.gray[5]};
  padding-bottom: 0.5rem;
  outline: none;
  margin-bottom: 5rem;
  &:focus {
    color: $oc-teal-7;
    border-bottom: 1px solid ${palette.gray[7]};
  }
  & + & {
    margin-top: 1rem;
  }
`;

/**
 * 폼 하단에 로그인 혹은 회원가입 링크를 보여줌
 */
const Footer = styled.div`
  margin-top: 2rem;
  text-align: right;
  a {
    color: ${palette.gray[6]};
    text-decoration: underline;
    &:hover {
      color: ${palette.gray[9]};
    }
  }
`;

const ButtonWithMarginTop = styled(Button)`
  margin-top: 1rem;
  position: absoulte;
  width: auto;
  height: 50px;
  margin: 1rem;
`;

const textMap = {
  login: "로그인",
  register: "기본정보"
};

/**
 * 에러를 보여줍니다
 */
const ErrorMessage = styled.div`
  color: red;
  text-align: center;
  font-size: 0.875rem;
  margin-top: 1rem;
`;
const techCompanies = [
  { label: "박윤범", value: 1 },
  { label: "개룐", value: 2 },
  { label: "입니다", value: 3 }
];
const RegisterAuthForm = ({ type, form, onChange, onSubmit, error }) => {
  const text = textMap[type];
  return (
    <AuthFormBlock>
      <h3>{text}</h3>
      <div style={{ float: "right" }}>
        <ButtonWithMarginTop onClick={e=>onSubmit(e,e.target.id)} type="submit" id ="temporarySave" form="myform" cyan fullWidth style={{ marginTop: "1rem" }}>
          {"임시저장"}
        </ButtonWithMarginTop>
      </div>
      <form onSubmit={onSubmit} id="myform">
        <StyledInput
          autoComplete="username"
          name="username"
          placeholder="사업자등록증 첨부"
          type = "file"
          onChange={onChange}
          value={form.username}
        />
        <StyledInput
          autoComplete="new-password"
          name="password"
          placeholder="비밀번호"
          type="password"
          onChange={onChange}
          value={form.password}
        />
        <StyledInput
          autoComplete="new-password"
          name="passwordConfirm"
          placeholder="비밀번호 확인"
          type="password"
          onChange={onChange}
          value={form.passwordConfirm}
        />
        <StyledInput
          autoComplete="businessLicenseNumber"
          name="businessLicenseNumber"
          placeholder="사업자등록번호"
          onChange={onChange}
          value={form.businessLicenseNumber}
        />
        <StyledInput
          autoComplete="businessOperatorName"
          name="businessOperatorName"
          placeholder="사업자명"
          onChange={onChange}
          value={form.businessOperatorName}
        />
        <Selector placeholder="판매상품 카테고리" options={techCompanies} />
        {error && <ErrorMessage>{error}</ErrorMessage>}
        <div style={{ float: "right" }}>
          <ButtonWithMarginTop cyan fullWidth style={{ marginTop: "1rem" }}>
            {"이전"}
          </ButtonWithMarginTop>
          <ButtonWithMarginTop cyan fullWidth style={{ marginTop: "1rem" }}>
            {"다음"}
          </ButtonWithMarginTop>
        </div>
      </form>
      <Footer>
        {type === "login" ? (
          <Link to="/register">회원가입</Link>
        ) : (
          <Link to="/login">로그인</Link>
        )}
      </Footer>
    </AuthFormBlock>
  );
};

export default RegisterAuthForm;
